INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, -363.0, "キャル", 7, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, -363.0, "コッコロ", 7, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, -363.0, "ペコリーヌ", 7, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, -363.0, "ペコリーヌ", 10, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, -363.0, "キャル", 10, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, -363.0, "コッコロ", 10, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, -363.0, "シェフィ", 10, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, -416.5, "ペコリーヌ", 12, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, -363.0, "キャル", 13, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, -363.0, "コッコロ", 13, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, -363.0, "シェフィ", 13, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, -363.0, "ペコリーヌ", 13, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, -363.0, "コッコロ", 14, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, -363.0, "シェフィ", 14, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, -363.0, "ペコリーヌ", 14, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, -363.0, "キャル", 14, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, -470.0, "コッコロ", 15, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, -363.0, "シェフィ", 16, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, -363.0, "ペコリーヌ", 16, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, -363.0, "キャル", 16, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, -363.0, "コッコロ", 16, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, -363.0, "コッコロ", 17, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, -363.0, "キャル", 25, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, -363.0, "コッコロ", 25, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, -363.0, "シェフィ", 25, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, -363.0, "ペコリーヌ", 25, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, -363.0, "カリン", 18, "2030/12/17 14:59:59", 0, 1, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, -363.0, "カリン", 18, "2030/12/17 14:59:59", 0, 2, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, -470.0, "カリン", 19, "2030/12/17 14:59:59", 0, 3, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, -470.0, "カリン", 19, "2030/12/17 14:59:59", 0, 4, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, -470.0, "カリン", 20, "2030/12/17 14:59:59", 0, 5, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, -470.0, "カリン", 20, "2030/12/17 14:59:59", 0, 6, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, -363.0, "キャル", 21, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, -363.0, "コッコロ", 21, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, -363.0, "シェフィ", 21, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, -363.0, "ペコリーヌ", 21, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, -430.0, "カリン", 22, "2030/12/17 14:59:59", 0, 1, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, -430.0, "カリン", 22, "2030/12/17 14:59:59", 0, 2, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, -430.0, "カリン", 23, "2030/12/17 14:59:59", 0, 3, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, -430.0, "カリン", 23, "2030/12/17 14:59:59", 0, 4, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4.08, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, -385.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 1, 109001, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5.0, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, -385.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 2, 109001, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10.11, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, -385.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 3, 109001, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4.0, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, -385.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 4, 109001, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6.0, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, -385.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 5, 109001, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 6, 109002, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 7, 109002, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 8, 109002, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 9, 109002, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0.0, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 10, 109002, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2.12, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, -385.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 1, 109101, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (4.19, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, -385.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 2, 109101, 0, 5, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (2.3, 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, -385.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 3, 109101, 0, 2, "2019/01/31 12:00:00", 4);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 0.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 4, 109102, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5.23, 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 8.0, -385.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 5, 109101, 0, 5, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 6, 109102, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5.01, 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, -385.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 7, 109101, 0, 1, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 8, 109102, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 9, 109102, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0.0, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 10011, 10, 109102, 0, 1, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, -363.0, "シェフィ", 26, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0.0, -363.0, "ペコリーヌ", 26, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, -363.0, "キャル", 26, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, -363.0, "コッコロ", 26, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0.0, -363.0, "シェフィ", 27, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 2, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0.0, -363.0, "ペコリーヌ", 27, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0.0, -363.0, "キャル", 27, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 27004, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0.0, -363.0, "コッコロ", 27, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 28001, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0.0, -363.0, "カリン", 28, "2030/12/17 14:59:59", 0, 1, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 28002, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 0.0, -363.0, "カリン", 28, "2030/12/17 14:59:59", 0, 2, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 29001, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 0.0, -409.0, "カリン", 29, "2030/12/17 14:59:59", 0, 3, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 29002, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0.0, -409.0, "カリン", 29, "2030/12/17 14:59:59", 0, 4, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 30001, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0.0, -409.0, "カリン", 30, "2030/12/17 14:59:59", 0, 5, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 30002, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0.0, -409.0, "カリン", 30, "2030/12/17 14:59:59", 0, 6, 190801, 0, 1, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 31001, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0.0, -409.0, "カリン", 31, "2030/12/17 14:59:59", 0, 7, 190801, 0, 1, "2019/10/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 31002, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0.0, -409.0, "カリン", 31, "2030/12/17 14:59:59", 0, 8, 190801, 0, 1, "2019/10/31 12:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 32001, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0.0, -409.0, "カリン", 32, "2020/01/04 4:59:59", 0, 1, 190801, 0, 1, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 32002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, -409.0, "カリン", 32, "2020/01/04 4:59:59", 0, 2, 190801, 0, 1, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 33001, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0.0, -409.0, "カリン", 33, "2020/01/04 4:59:59", 0, 3, 190801, 0, 1, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 33002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, -409.0, "カリン", 33, "2020/01/04 4:59:59", 0, 4, 190801, 0, 1, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 34001, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0.0, -409.0, "カリン", 34, "2020/01/10 11:59:59", 0, 5, 190801, 0, 1, "2020/01/04 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 34002, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0.0, -409.0, "カリン", 34, "2020/01/10 11:59:59", 0, 6, 190801, 0, 1, "2020/01/04 5:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (5.3, 38001, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 0.0, -458.0, "ペコリーヌ", 38, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (6.5, 38002, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 0.0, -458.0, "ペコリーヌ", 38, "2030/12/17 14:59:59", 0, 2, 105801, 0, 1, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 39005, "", 9999.0, 9999.0, "ペコリーヌ", 39, "2020/04/08 23:59:59", 0, 0, 105801, 0, 3, "2020/04/01", 3);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 40001, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0.0, -430.0, "カリン", 40, "2030/12/17 14:59:59", 0, 2, 190801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 41001, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 0.0, -363.0, "シェフィ", 41, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 41002, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0.0, -363.0, "ペコリーヌ", 41, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 41003, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0.0, -363.0, "キャル", 41, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 41004, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0.0, -363.0, "コッコロ", 41, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 42001, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0.0, -416.5, "コッコロ", 42, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 42002, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 0.0, -416.5, "シェフィ", 42, "2030/12/17 14:59:59", 0, 1, 106401, 2104010, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 42003, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0.0, -416.5, "ペコリーヌ", 42, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 42004, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0.0, -416.5, "キャル", 42, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 43001, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0.0, -363.0, "ペコリーヌ", 43, "2030/12/17 14:59:59", 0, 1, 105801, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 43002, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0.0, -363.0, "コッコロ", 43, "2030/12/17 14:59:59", 0, 1, 105901, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 43003, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0.0, -363.0, "キャル", 43, "2030/12/17 14:59:59", 0, 1, 106001, 0, 1, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 43004, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0.0, -416.5, "アメス", 44, "2030/12/17 14:59:59", 0, 1, 123001, 0, 1, "2015/12/17 15:00:00", 1);
